INSERT INTO "public"."npc_dialogue" VALUES (1, 410, 'Welcome to the D.M.Z 0x4155 training courtyard, soldier.', 'orientation-1', 'what corp should say at orientation', 1, 0, '2020-10-04 04:06:45.269353', '2020-10-04 04:06:45.269353');
INSERT INTO "public"."npc_dialogue" VALUES (2, 410, 'Here you will master the basics skills to make you an effective asset out in the field of combat.', 'orientation-1', 'what corp should say at orientation', 1, 1, '2020-10-04 04:06:45.277572', '2020-10-04 04:06:45.277572');
INSERT INTO "public"."npc_dialogue" VALUES (3, 410, 'To see what training courses are available {yel}look{/yel} at the {blu}Course Selection Interface{/blu}.', 'orientation-1', 'what corp should say at orientation', 1, 2, '2020-10-04 04:06:45.285879', '2020-10-04 04:06:45.285879');
INSERT INTO "public"."npc_dialogue" VALUES (4, 410, 'To start a course, type {yel}start ID{/yel} where ID is the id of the course on the far left of the screen.', 'orientation-1', 'what corp should say at orientation', 1, 3, '2020-10-04 04:06:45.29423', '2020-10-04 04:06:45.29423');
INSERT INTO "public"."npc_dialogue" VALUES (5, 410, 'If you are already accustomed to this system, disregard my instructions and proceed when you ready.', 'orientation-1', 'what corp should say at orientation', 1, 4, '2020-10-04 04:06:45.302534', '2020-10-04 04:06:45.302534');
INSERT INTO "public"."npc_dialogue" VALUES (6, 410, 'Demolitions HOW TO: Section: GRENADES|=====================================|Step 1) Hold your grenade|run the command: {yel}hold grenade{/yel}||Step 2) Throw grenade.|run the command: {yel}throw grenade DISTANCE{/yel}|{grn}replace the phrase DISTANCE with the number of rooms you would like to throw.{/grn}|||Demolitions HOW TO: Section: C4|===========================================|Step 1) Attach the C4 to an object, door, person, or vehicle.|run the command: {yel}attach c4 ITEM{/yel}|{grn}replace the phrase ITEM with the target object, person, vehicle, or direction.{/grn}||Step 2) Detonate the C4.|run the command: {yel}detonate{/yel}|||Demolitions HOW TO: Section: Claymore Mines|===========================================|Step 1) Install the claymore mine at the specified door.|run the command: {yel}install claymore DIRECTION{/yel}|{grn}replace the phrase DISTANCE with the direction of the door you would like to install the claymore mine on.{/grn}||', 'demolitions-howto', 'what corp should say at orientation regarding demolitions', 2, 0, '2020-10-04 04:06:45.311034', '2020-10-04 04:06:45.311034');
INSERT INTO "public"."npc_dialogue" VALUES (7, 410, 'Demolitions HOW TO: Section: GRENADES|=====================================|Step 1) Hold your grenade|run the command: {yel}hold grenade{/yel}||Step 2) Throw grenade.|run the command: {yel}throw grenade DISTANCE{/yel}|{grn}replace the phrase DISTANCE with the number of rooms you would like to throw.{/grn}|||Demolitions HOW TO: Section: C4|===========================================|Step 1) Attach the C4 to an object, door, person, or vehicle.|run the command: {yel}attach c4 ITEM{/yel}|{grn}replace the phrase ITEM with the target object, person, vehicle, or direction.{/grn}||Step 2) Detonate the C4.|run the command: {yel}detonate{/yel}|||Demolitions HOW TO: Section: Claymore Mines|===========================================|Step 1) Install the claymore mine at the specified door.|run the command: {yel}install claymore DIRECTION{/yel}|{grn}replace the phrase DISTANCE with the direction of the door you would like to install the claymore mine on.{/grn}||', 'demolitions-howto', 'what corp should say at orientation regarding demolitions', 2, 0, '2020-10-04 04:06:45.361267', '2020-10-04 04:06:45.361267');
INSERT INTO "public"."npc_dialogue" VALUES (8, 410, 'Drone assisted sniping HOW TO:|==============================|Step 1) Deploy your drone.|run the command: {yel}deploy drone{/yel}|You will now see the world through the eyes of your drone.||Step 2) Fly or ground travel to the target room.|run any direction commands to get to the room where your target enemy is. (north, east, south, etc)...||Step 3) Target your enemy.|run the command: {yel}target ENEMY{/yel} where ENEMY is the name of the mob.||Step 4) Snipe your target.|type this exactly to snipe your enemy: {yel}snipe target{/yel}. If you try to use |any other phrase other than target, the command will not work.||', 'drone-assisted-sniping-howto', 'course page for drone assisted sniping', 2, 0, '2020-10-04 04:06:45.369464', '2020-10-04 04:06:45.369464');
