INSERT INTO "public"."room" VALUES (3, 132, 1, 21, '{blu}C.O.F.O.B:{/blu} - Southern Hallway', 'The cement floor is a perfect complement to the reflection of the incandescent lights that are installed into the the ceiling. {gld}To the East{/gld}, you will find the Armory. {gld}To the West{/gld}, you will find the training grounds. Just around the corner to the East and North a ways is the Weapons Locker. Feel free to get acquainted with the layout, recruit.
