INSERT INTO "public"."room" VALUES (149, 278, 1, 0, 'Destroyed overpass - Abott Market South', 'Crushed and flattened by endless shells, the overpass that you just passed under creaks eternally. Now and then you hear the crumble of asphault and be bend of metal rods. The overpass connects the once thriving market place of Abott Market, but now all you see is rubble and a shell of what used to be a thriving market.
