INSERT INTO "public"."room" VALUES (70, 199, 1, 21, '{blu}C.O.F.O.B:{/blu} - Eastern Exit', 'Before you is a sturdy metal door that prevents the outside elements from making their way inside. The door simply says {yel}Eastern Exit{/yel}. The air is less cool as the corridor leading to the east lacks the sufficient air flow. There are no ventilation shafts leading to the east, but you can see through the tempered glass window on the door that a few military police are gaurding the exit to the city outside. 
INSERT INTO "public"."room" VALUES (84, 213, 1, 0, '{blu}C.O.F.O.B [OUTER]:{/blu} - Western Hallway', 'The reinforced metal walls are briefly interrupted by the occasional senior officer door. As you make your way north and south, you notice that the entirety of the western wall consists of metal walls with doors that lead to the underground portion of the base. 
