INSERT INTO "public"."room" VALUES (129, 258, 1, 0, '{blu}C.O.F.O.B:{/blu} - Engineering hallway', 'The doors on the eastern wall are all closed and most likely locked. You see the commons area at the end of the hallway. You notice various surveillance cameras strategically placed at the corners of the ceiling. 
INSERT INTO "public"."room" VALUES (133, 262, 1, 0, '{blu}C.O.F.O.B:{/blu} - Commons area', 'A comfy looking couch and recliner welcome you to the engineering commons area. Three television screens mounted on the west wall display various graphs and statistics. A ping pong table is in the center of the room. Two large refridgerators are humming quietly in the corner. The north wall consists of large one-way tinted windows that overlook the training fields below. To the east is the entrance to server room 1B.
INSERT INTO "public"."room" VALUES (150, 279, 1, 0, 'Destroyed overpass - Abott Market South', 'Crushed and flattened by endless shells, the overpass that you just passed under creaks eternally. Now and then you hear the crumble of asphault and be bend of metal rods. The overpass connects the once thriving market place of Abott Market, but now all you see is rubble and a shell of what used to be a thriving market.
INSERT INTO "public"."room" VALUES (170, 299, 1, 0, 'Market Apartments - Stairs', 'Before you lie the stairs that will help you reach the second floor of building 3. The handrails are extremely hot to the touch due to baking here under the steady gaze of the sun over your shoulder.
INSERT INTO "public"."room" VALUES (183, 312, 1, 0, 'Market Apartments - Building 3 - Unit 303', 'A mostly empty apartment. You notice what looks like sleeping bags in the corner but that could just be trash. The air smells like cigarette smoke and dry desert air. The light from outside illuminates trillions of dust particles floating in the in perpetual motion.
INSERT INTO "public"."room" VALUES (195, 324, 1, 0, 'Market Apartments - Building 3 Second floor hallway', 'A thin layer of dust and dirt cover the cement walkway here. You hear the crackle of dirt and millions of pieces of broken glass under your feet as you make your way about. Oddly enough, there are footprints here.
INSERT INTO "public"."room" VALUES (196, 325, 1, 0, 'Market Apartments - Building 3 - Unit 307', 'A mostly empty apartment. You notice what looks like sleeping bags in the corner but that could just be trash. The air smells like cigarette smoke and dry desert air. The light from outside illuminates trillions of dust particles floating in the in perpetual motion.
