INSERT INTO "public"."room" VALUES (233, 361, 1, 0, '{blu}Crenshaw{/blu} Highway overpass', 'A newly paved road stretching to the east and curving towards the north. Speed limit signs are present but they aren''t taken seriously by the civilians. Admittedly, the only residents that use the highways are the ones with disproportionate amounts of wealth. You notice a few carcasses of dead animals that made the dire decision to cross this hellish landscape.
