INSERT INTO "public"."room" VALUES (369, 497, 1, 0, '{blu}Saint Vale Church{/blu} Parking Lot', 'A huge parking lot for a giant congregation. There are administration and community buildings to the north where people often hold weddings and other communal gatherings. To the south you spot a building where the staff go when services are over. It seems to be heavily fortified, which seems odd, given that this is a place of worship. The Church itself is to the East and it''s main bell tower casts a looming shadow over the rest of the building and parking lot.
