INSERT INTO "public"."room" VALUES (556, 685, 1, 0, '{blu}Metro{/blu} Bornald Road', 'The road to the heart of Metro City is a bustling hive of busy upper city residents. While the majority of the people who work in Downtown Metro are mid to upper class citizens, a large disproportionate chunk of the people who gather here are drugged out degenerates. Several homeless families make camp right in the middle of the sidewalk: their life for all to judge. 
INSERT INTO "public"."room" VALUES (557, 686, 1, 0, '{blu}Metro{/blu} Henley Fountain', 'A tribute to the Henley Corporation, an elaborately crafted fountain was erected in the early stages of development of Downtwon Metro City. The water is cleaned several times before it''s recycled and spat back out. The fountain has a rectangular cement wall that keeps the water inside. There are elaborately chiseled patterns at the bottom of the pool and on the inner walls.
