INSERT INTO "public"."room" VALUES (726, 858, 1, 0, '{blu}Shipyard{/blu} Entrance', 'Shipping containers stacked 30 to 40 stories high blot out the sun''s rays coming from the east and even overhead during lunch time. Despite the time of day, artificial lighting is needed everywhere. As you make your way deeper into the shipyard, you notice several highly armed individuals patrolling the area. These individuals are wearing masks and have extensive radio communication devices that are resistant to E.M.P.. 
