INSERT INTO "public"."room" VALUES (733, 865, 1, 0, '{blu}Shipyard{/blu} Shipment Row A', 'All around you are red and blue shipping containers with varying amounts of rust and outer wear. A few have severe indentations from mishaps. Oddly enough, containers with giant abrasions are bent back into shape and reused. You notice what seems to be burn marks, bullet holes, and dark splattered brownish red stains on a few containers. 
