INSERT INTO "public"."room" VALUES (739, 871, 1, 0, '{blu}Psi-Tech H.Q.{/blu} - Outside - Main courtyard', 'The entrance to {blu}Psi-Tech{/blu} is a stark contrast to the poverty of the surrounding area. The outside of the building is a bland grey-blue mix. Each walkway has stairs and a futuristic looking angular railing. Each corner of the paved sidewalk looks like a sleek cutout from a futuristic jet.The walkway curves down towards the main entrance. You notice a few cameras watching your movement.
