INSERT INTO "public"."room" VALUES (207, 336, 1, 0, 'Abandoned Two way street - Abott Market', 'A trio of burning cars have become part of the debris scattered along the street. Way off to the north, you spot a working overpass. Deep long scars of blackened concrete tell a tale of destruction. To the west lies a small set of apartments once owned by the only property company to operate in this desolate portion of town. A giant construction crane is resting in the middle of the street to the north.
