INSERT INTO "public"."room" VALUES (109, 238, 1, 21, '{blu}C.O.F.O.B{/blu} - Engineering - Threat Surveillance', 'There are a couple high profile incidents where law enforcement were locked out of the personal devices of a deceased criminal. A hard lesson in cryptography was learned that day. As a result, funding instead went into massive amounts of global surveillance and threat tracking. The advent of Artificial Intelligence gave another possible avenue: automated tracking. The {red}Threat Surveillance{/red} sector of the FOB is the most advanced and funded aspect of every FOB to date.
