INSERT INTO "public"."room" VALUES (1342, 1086, 1, 0, '{blu}Kojima{/blu} - Inside Kojima Corp', 'The inside of {red}Kojima Corp{/red} looks and feels like an office turned into a permanent underground bunker. The reinforced walls have burn marks. There are footprints of heavy duty boots and spent shell casings lining the metal floors. Cameras built in to the walls sit behind thick reinforced glass. You feel like you''re being watched. Each step you take makes a clunking sound against the metal floor. You step over ruined concrete and tracked-in mud every couple of steps. Tall narrow glass windows are placed very high near the ceiling.
