INSERT INTO "public"."scripted_steps" VALUES (99, 26, 9, 600, 0, 143, 0, 0, NULL, NULL, 'act', '$n looks up from a messy desk full of detailed readouts..');
INSERT INTO "public"."scripted_steps" VALUES (100, 26, 9, 600, 0, 143, 0, 1, NULL, NULL, 'dialogue', 'The scanner? Give it here...');
INSERT INTO "public"."scripted_steps" VALUES (101, 26, 3, 600, 0, 143, 0, 2, NULL, NULL, 'act', '$n attaches a long orange cable to the bottom of the biometric scanner');
INSERT INTO "public"."scripted_steps" VALUES (102, 26, 3, 600, 0, 143, 0, 3, NULL, NULL, 'dialogue', 'Yes... these are definitely human remains. Though I do see an advanced type of mutation occurring. It''s almost as if this sample were taken off of a living breathing human. I don''t understand how this sort of thing could be possible. It defies all scientific explanation.');
INSERT INTO "public"."scripted_steps" VALUES (103, 26, 3, 600, 0, 143, 0, 4, NULL, NULL, 'act', '$n types a few commands into a computer terminal.');
INSERT INTO "public"."scripted_steps" VALUES (104, 26, 3, 600, 0, 143, 0, 5, NULL, NULL, 'dialogue', 'I will get these results to my international colleagues for further study. I will give Corporal Crawford the results of my studies. That is all for now...');
INSERT INTO "public"."scripted_steps" VALUES (105, 26, 3, 600, 0, 143, 0, 6, NULL, NULL, 'act', '$n rubs his temples in an effort to quell a severe migraine...');
INSERT INTO "public"."scripted_steps" VALUES (135, 5, 3, 600, 0, 143, 0, 5, NULL, NULL, 'say', 'I must get back to my work unfortunately.');
INSERT INTO "public"."scripted_steps" VALUES (136, 5, 0, 0, 0, 0, 0, 0, NULL, NULL, 'placeholder', NULL);
