description: the ''install'' command is used to install 
devices like cameras or claymore mines. To install a claymore
mine, you would simply type ''install claymore north''. This would
install the claymore to the north exit of the room. Any NPC that
leaves or enters the current room through the northern exit will
be met with an explosion.

The other use case of the ''install'' command is to install cameras
onto a wall inside a room. To install a camera on the north side of
the room, you would type ''install camera north''.

To remove the device, use the ''uninstall'' command
Type ''help uninstall'' for more information.

To cancel the installation of a device while you are currently
installing it, you must type ''cancel''

For more information: see the help manual for the following keywords:
''cancel'',''camera'',''claymore'',''install'',''uninstall''

This documentation was written on 2020-03-29.', '2022-01-15 00:16:35.01271', '2022-01-15 00:16:35.01271');
