The unlock-event will be one of the following:
unlock <direction>
lock <direction>
toggle <direction>

The unlock-event can also work with several directions separated by commas
The unlock-event can work with room virtual numbers and directions
unlock vnum:40 <direction>
lock vnum:40 <direction>
toggle vnum:40 <direction>
If the unlock-event is neither of the above strings, then it will be fed to the system
and handled accordingly.
Example of a custom event:
{blu}Example: {yel}install_minigame "North Door Lock" medium custom "custom event. handled by system"{/yel}
The ''custom'' keyword takes whatever you pass in and the system interprets it. This is for adding custom events
that might work in the future or if the developers have a custom even that allow you to do special things.
As of this writing, there are no custom events. 2020-09-28
{blu}Example: {yel}install_minigame "North Door Lock" line-up medium unlock north{/yel}
{blu}Example: {yel}install_minigame "North Door Lock" line-up medium unlock vnum:40 north,south,east,west{/yel}
{blu}Example: {yel}install_minigame "North Door Lock" line-up medium toggle vnum:40 south,west,up{/yel}

