   S N I P I N G    |
____________________|
 Ability:     X-ray shot
 Command:     xray_shot <no-args>
{hr} Description: Hit a target through walls or doors. X-ray shot does not requi-
              you to have your target within your line of sight. You can be  
              several rooms away and still do damage to your target.         

 Usage: xray_shot

E X A M P L E
{hr}{grn}$>{/grn} mark Enforcer 
{grn}::{/grn} CONFIRM :: Marked target
{grn}$>{/grn} engage 
{grn}::{/grn} CALIBRATE :: Okay -: Target locked :-
{grn}$>{/grn} xray_shot 
You OBLITERATE A Military Police enforcer with your deadly snipe!!
{grn}$>{/grn} disengage 
{grn}::{/grn} DISENGAGED
{grn}$>{/grn} xray_shot 
{grn}::{/grn} NO TARGET CALIBRATED
                                  
{hr} Ability: Tracking Shot 
 Command: tracking_shot <target> <direction>
{hr} Description: targets that are marked take extra damage.
{hr} Ability: Mark Target
 Command: mark <target>
{hr} Description: For use with x-ray shot.
{hr} Ability: Mark Target
 Command: mark <target>
{hr} Description: For use with x-ray shot.
{hr} Ability: Attach frag grenade underbarrel
 Command: attach_frag
{hr} Description: Attaches a fragmentation grenade launcher to your primary.
 Once you''ve attached the launcher, use {grn}fire <direction> <count>{/grn}
{hr}E X A M P L E 
{hr}{grn}$>{/grn} attach_frag 
{grn}You attach an PWM Grenade Launcher to your primary weapon{/grn}
{grn}$>{/grn} fire north 3 
{grn}You launch a fragmentation grenade way off to the north!{/grn}
{hr} Description: For use with x-ray shot.
{grn}target_limb{/grn}: specify the limb to target.
{grn}tracking_shot{/grn}: tracking your target.
{yel}Usage:{/yel}{grn}tracking_shot <target> <direction>{/grn}
{yel}Example:{/yel}
{grn}$> tracking_shot enforcer east{/grn}
{grn}You tag your target!{/grn}
Tagged enemies take extra damage.
 ____________________ 
|      Healing       |
|____________________|
{grn}light_bandage{/grn}: use to regain some hp
{grn}suture{/grn}: regain more hp than light_bandage but at the cost of movement points
{grn}adrenaline_shot{/grn}: inject yourself with adrenaline and get +5 armor, +5 movement, and +3 strength
 ____________________ 
|     Demolitions    |
|____________________|
{grn}build_claymore{/grn}: creates a claymore in your inventory (if you have a charge left).
{grn}build_shrapnel_claymore{/grn}: creates a {grn}shrapnel{/grn} claymore in your inventory (if you have a charge left).
{grn}build_corrosive_claymore{/grn}: creates a {grn}corrosive{/grn} claymore in your inventory (if you have a charge left).
{grn}guided_missile{/grn}: pre-program a guided missile to travel and detonate at the end of the path.
{yel}Usage:{/yel}{grn}guided_missile <direction>...[direction]
{yel}Example:{/yel}{grn}guided_missile n e e n n w{/grn}
The above example will send a guided missile along the path until it reaches the last direction (west)
upon which it will detonate in that room.
 ____________________ 
|     I N T E L      |
|____________________|
{grn}build_emp{/grn}: creates an EMP grenade in your inventory (if you have a charge left).
{grn}build_chaff{/grn}: creates a Chaff grenade in your inventory (if you have a charge left).
{grn}build_sensor{/grn}: creates a Sensor grenade in your inventory (if you have a charge left).
{grn}request_recon{/grn}: creates a Sensor grenade in your inventory (if you have a charge left).

{grn}attach_shotgun{/grn}: activate an underbarrel shotgun with 5 shells pre-loaded.
  {yel}Usage:{/yel}{grn}attach_shotgun{/grn}
  Once you''ve attached the shotgun, the next same-room fire fight you''re in will use the underbarrel
  shotgun until it''s ammo is depleted. Once the shotgun''s ammo is depleted, you will switch back to your
  primary weapon''s main attack.
{grn}attach_frag{/grn}: activate an underbarrel grenade launcher with 3 grenades pre-loaded.
{yel}Usage:{/yel}{grn}attach_frag{/grn}
Once you''ve attached the launcher, use {grn}fire <direction> <count>{/grn}
{yel}Example:{/yel}
{grn}$> attach_frag{/grn}
{grn}You attach an PWM Grenade Launcher to your primary weapon{/grn}
{grn}$> fire north 3{/grn}
{grn}You launch a fragmentation grenade way off to the north!{/grn}
{grn}target_limb{/grn}: specify the limb to target.
{yel}Usage:{/yel}{grn}target_limb <right-arm|left-arm|none>
{yel}Example:{/yel}
{grn}$> target_limb right-arm{/grn}
{grn}You start targeting the right arm of your opponents.{/grn}
{grn}$> snipe Enforcer west{/grn}
{grn}You OBLITERATE A Military Police enforcer with your deadly snipe!!{/grn}
{grn}*** LIMB DAMAGE (right-arm) [ INTEGRITY: POOR ] ***
{grn}$> snipe Enforcer west{/grn}
{grn}You OBLITERATE A Military Police enforcer with your deadly snipe!!{/grn}
{grn}*** LIMB DAMAGE (right-arm) [ INTEGRITY: USELESS ] ***

Once a limb reaches {yel}USELESS{/yel}, the limb is effectively destroyed.

|-----------------------|
| A note on handed-ness |
|-----------------------|
 Every NPC is right-handed by default. An NPC uses their left hand to utilize a secondary weapon such 
 as a pistol. NPC''s will use their right hand to utilize their primary weapon. This goes for rifles and melee weapons.
{hr}
{hr} Limb damage and effects on {grn}MELEE{/grn} primary weapon
{hr} LIMB EFFECTS 
{hr} Right arm: 1 or more of the below will occur...
            * 30 percent reduced chance to hit target 
            * 1l percent damage reduction for 33 ticks
            * reduce dice sides by 10-25 percent for 45 ticks 
{hr} Left arm:  1 or more of the below will occur...
            * next 3 attacks do half damage     
{hr} Limb damage and effects on {grn}RIFLE{/grn} primary weapon
{hr} LIMB EFFECTS 
{hr} Right arm: 1 or more of the below will occur...
            * 25 percent reduced damage with primary weapon
            * 33 percent chance of jamming primary weapon
            * 40 percent penalty to accuracy
            * 20 percent chance of dropping primary weapon
            * 14 percent chance of primary magazine emptying
{hr} Left arm:  1 or more of the below will occur...
            * 35 percent less likely to deal critical shots
            * add 15 ticks to cooldown between shots
            * 25 percent damage reduction for 60 ticks
{hr}{grn}xray_shot{/grn}: specify the limb to target.

