description: the yaml_log command has two types of usages.
1) calling yaml_log with no arguments will send you the current yaml log
2) calling yaml_log the same way you would call yaml_import
Example: yaml_log RIFLE g36c.yml
The above example will attempt to import and give you the g36c.yml file.
Should any exceptions with the yaml import occur, you can see the log
of those errors by calling yaml_log with no arguments.

